def test_similarity(data, text):
    filter = model.similarity(data, text).tolist()
    index = -1
    max = 0
    # print(filter)
    for i in range(len(filter)):
       test = float(filter[i][0])
       if test>max:
          index = i
          max = test
    if max<0.1:
        # print(max)
        index = -1
    return documents[index]
def create_embeddings(chunks):
    embeddings = model.encode(chunks)
    return embeddings
